import React from 'react';
import logo from '../assets/logo.png';

const Homepage = () => {
    return (
        <div className = "homepage">
            <div className = "logo-parent">
                <img src = {logo} alt = "logo" className = "logo" />
            </div>
        </div>
    );
}

export default Homepage;
